(function(){Vue.component("convos-toggle-main-menu",{methods:{classNames:function(){var cn={"toggle-main-menu":true};if(this.settings.mainMenuVisible)cn.active=true;return cn;},toggleMainMenu:function(){if(!this.settings.mainMenuVisible)this.settings.sidebar="";this.settings.mainMenuVisible=!this.settings.mainMenuVisible;}},template:"<a :class=\"classNames()\" @click.prevent=\"toggleMainMenu\" href=\"#main-menu\"><i class=\"material-icons\">dehaze</i></a>\n"})})();